import React from 'react'

export const Home = () => {
  return (
    <div>
        <h1>configurações</h1>
        <h1>astromatch</h1>
        <h1>matches</h1>
        <img src="https://placehold.it/500x300" alt="foto"/>
        <img src="https://placehold.it/500x30" alt="botao deslike"/>
        <img src="https://placehold.it/500x30" alt="botao like"/>
    </div>
  )
}
